import React from 'react';

// Storybook
import { optionsKnob as options } from '@storybook/addon-knobs';

// Components
import { Button } from './Button';
import { StoryArticle, StoryHeader } from '../../../utils/storybook/StyledStoryComponents';
import Docs from './BUTTON.md';

// Utils
import { createStory } from '../../../utils/storybook/storybookUtils';

createStory('Atoms|Button').add('All', () => {
  return (
    <StoryArticle>
      <StoryHeader>
        <h1>Label</h1>
      </StoryHeader>

      <StorySection>
        <Button>Click Me</Button>
      </StorySection>
    </StoryArticle>
  );
},
{
  notes: {
    markdown: Docs,
  },
});
